import KontrlPopup from "./KontrlPopup";

class GenericKontrlPopup extends KontrlPopup {
  constructor() {
    super();
  }

  public build() {
    const popupEl = document.createElement("div");
    popupEl.appendChild(document.createTextNode("test"));
    return popupEl;
  }

  public show(): void {
    console.log("Show")
  }

  public hide(): void {
    console.log("hide")
  }


}

export default GenericKontrlPopup;
